import React, {useEffect, useState} from 'react';
import { Link } from 'react-router-dom';

import './styles.css'

import api from '../../services/api'

export default function DashboardUsu({history}){
    const [dados, setDados]=useState([]);
    const [id, setId]=useState('');

    function ativar(event){
        event.preventDefault();

        event=>setId(dado._id);

    }
    function desativar(){

    }




    useEffect(()=>{
        async function DadosUsu(){
            const _id = localStorage.getItem('user');
            const response = await api.get('/usuarios');
            
            setDados(response.data);
            
        }
        DadosUsu();
        
    }, []);

    return (
        <div className="tabela">
            
            <ul className="usuario-list">
                <li className="indices">
                <h1>Nome</h1>
                <h1>CPF</h1>
                <h1>E-mail</h1>
                <h1 className="nivelAcesso">Status</h1>
                </li>
        
            {
                dados.map(dado=>(
                <li key={dado._id}>
                        <header className="imagem" style={{
                            backgroundImage: `url(${dado.imgPerfil_url})`
                        }}/>
                        <h1>{dado.nome}</h1>
                        <h1>{dado.cpf}</h1>
                        <h1>{dado.email}</h1>
                        <h1 className="nivelAcesso">{dado.nivelAcesso}</h1>
                    
                        <button onClick={ativar}>Ativar</button>
                        <button onClick={desativar}>Desativar</button>
                    
                    </li>
                    ))
                    }
            </ul>
    </div>
    );
}
